import React from 'react';

const Skills = () => {
  return (
    <section id="skills" className="section">
      <h2>Skills</h2>
      <ul>
        <li><strong>Frontend:</strong> HTML, CSS, JavaScript, React.js, Bootstrap</li>
        <li><strong>Backend:</strong> Node.js, Express.js, Python</li>
        <li><strong>Database:</strong> MongoDB, SQLite</li>
        <li><strong>Tools:</strong> Git, REST API, JWT, Postman, React Router, Vercel, Figma</li>
      </ul>
    </section>
  );
};

export default Skills;
